How to upsert with MongoDB array?<p>I am trying to insert, update values in the MongoDB array.<br />
My MongoDB version is 4.0.5.</p>
<p>Here is my collection :</p>
<pre><code>{
    'id': 1,
    'array': [{
        'code': 'a'
    }, {
        'code': 'b'
    }]
}
</code></pre>
<p>I am trying to make some upsert queries to insert/update into an array but I don't found a good solution until then.</p>
<p>My filters are :</p>
<ul>
<li><code>'id'</code> (to point the correct document)</li>
<li><code>'array.code'</code> (to point the correct array cell)</li>
</ul>
<ol>
<li>If the document exists in the collection but there is no cell with <code>'code': 'c'</code></li>
</ol>
<pre><code>db.test.update({
        'id': 1
    }, {
        $set: {'array.$[elem].test':'ok'}
    }, {
        upsert: true,
        arrayFilters: [{'elem.code': 'c'}]
    }
)
</code></pre>
<p>I have no error but no upsert too.<br />
I want to insert the element in the array like this :</p>
<pre><code>// Desired result
{
    'id': 1,
    'array': [{
        'code': 'a'
    }, {
        'code': 'b'
    }, {
        'code': 'c'
        'test': 'ok'
    }]
}
</code></pre>
<ol start="2">
<li>If the document doesn't exist in the collection</li>
</ol>
<pre><code>db.test.update({
        'id': 3
    }, {
        $set: {'array.$[elem].test':'ok'}
    }, {
        upsert: true,
        arrayFilters: [{'elem.code': 'a'}]
    }
)
</code></pre>
<p>In that case, I have this error :</p>
<blockquote>
<p><code>WriteError: The path 'array' must exist in the document in order to apply array updates., full error: {'index': 0, 'code': 2, 'errmsg': &quot;The path 'array' must exist in the document in order to apply array updates.&quot;}</code></p>
</blockquote>
<p>I want to upsert a new document with elements of the query like this :</p>
<pre><code>// Desired result
{
    'id': 3,
    'array': [{
        'code': 'a'
        'test': 'ok'
    }]
}
</code></pre>
<p><code>upsert: true</code> in the query parameters doesn't seem to work with the array.<br />
Your help will be highly appreciated.</p>

