Autocomplete filtered with mongodb<p>I would like to perform autocompletion on the <strong>name</strong> but filtered on a specific city with mongoose and nodejs.
I have a mongodb collection like this :</p>
<pre><code>{
    &quot;_id&quot; : ObjectId(&quot;6007fd9d984e2507ad452cf3&quot;),
    &quot;name&quot; : &quot;John&quot;,
    &quot;city&quot; : &quot;A&quot;,
},
{
    &quot;_id&quot; : ObjectId(&quot;6007ff6844d9e517e1ec0976&quot;),
    &quot;name&quot; : &quot;Jack&quot;,
    &quot;city&quot; : &quot;B&quot;,
}
</code></pre>
<p><strong>What i have done so far :</strong></p>
<p>I have setup MongoDB Atlas with a Search Index (with the help of <a href="https://docs.atlas.mongodb.com/atlas-search/" rel="nofollow noreferrer">search doc</a>)
And set up the autocomplete like that :</p>
<pre><code>router.get('/search', async (request, response) =&gt; {
  try {
    let result = await Client.aggregate([
      {
        &quot;$search&quot;: {
          &quot;autocomplete&quot;: {
            &quot;query&quot;: `${request.query.term}`,
            &quot;path&quot;: &quot;name&quot;,
            &quot;fuzzy&quot;: {
              &quot;maxEdits&quot;: 2,
              &quot;prefixLength&quot;: 3,
            },
          },
        },
      },
      {
        $limit: 3
      },
      {
        $project: {
          &quot;_id&quot;: 0,
        }
      }
    ]);
    response.send(result);
  } catch (e) {
    response.status(500).send({message: e.message});
  }
});
</code></pre>
<p>In front-end, with <a href="https://tarekraafat.github.io/autoComplete.js/#/" rel="nofollow noreferrer">autocompleteJs</a> :</p>
<pre><code>  const autoCompleteJS = new autoComplete({
    data: {
      src: async () =&gt; {
        const query = document.querySelector(&quot;#autoComplete&quot;).value;
        const source = await fetch(`${window.location.origin}/search?term=${query}`);
        const data = await source.json();
        return data;
      },
      key: [&quot;name&quot;],
    },
    trigger: {
      event: [&quot;input&quot;, &quot;focus&quot;],
    },
    searchEngine: &quot;strict&quot;,
    highlight: true,
  });
</code></pre>
<p>So far it is working well. But I don't know how to make the autocomplete result filtered based on city. It seems that the <a href="https://docs.atlas.mongodb.com/reference/atlas-search/autocomplete/#std-label-autocomplete-ref" rel="nofollow noreferrer">documentation</a> does not mention this. Do you have any leads.</p>

